	(4,'**Dear Customer,**\n\nWe have been notified of a few instances where some unscrupulous people have duped customers promising high returns by selling fake products. The fraudsters under the guise of representing Star Union Dai ichi Life Insurance company send payment links not associated with our company.\n\nBeware of spurious calls . Please visit our official website [www.sudlife.in](www.sudlife.in) for all our product features and benefits. Please do not open any unsolicited link received via SMS. Be wary of sharing personal information or policy details with unknown callers.\nIn case of any suspicion, please write to us at [customercare@sudlife.in](customercare@sudlife.in) or call us on our toll-free number [1800-266-8833](1800-266-8833)'),
	(5,'**Dear Customer,**\n\nWe have been notified of a few instances where some unscrupulous people have duped customers promising high returns by selling fake products. The fraudsters under the guise of representing Star Union Dai ichi Life Insurance company send payment links not associated with our company.\n\nBeware of spurious calls . Please visit our official website [www.sudlife.in](www.sudlife.in) for all our product features and benefits. Please do not open any unsolicited link received via SMS. Be wary of sharing personal information or policy details with unknown callers.\nIn case of any suspicion, please write to us at [customercare@sudlife.in](customercare@sudlife.in) or call us on our toll-free number [1800-266-8833](1800-266-8833)'),
	(6,'Star Union Dai-ichi Life Insurance Company Limited (SUD Life/ Company/ Us/ We) is committed to respecting your privacy and protecting your personal data, which is any information that is capable of identifying you as an individual person, collected via all websites or apps that post a link to this Privacy Policy (collectively, the Sites). This Privacy Policy describes how we handle and protect your personal data in connection with the Sites, in our capacity as data controllers. In cases, this Privacy Policy should be read together with Information and Cybersecurity policy of SUD Life.<br>\n\n**Definitions**\n- You or Your or User(s)- refers to the person accessing the Website in any capacity.\n- We or us  refers to Star Union Dai-ichi Life Insurance Company Limited.\n- Website- refers to www.SUDlife.in\n- Services - all services made available by the Company.<br>\n\n\n**Information we collect**\nSUD Life collects personal data on certain areas of the Sites at the time of application or servicing of insurance policy. Like the personal data collected varies across the Site and may include information that you provide such as your name, mailing address, e-mail address, telephone number, fax number and other related personal information.\n\nWe may also automatically collect information about the devices you use to interact with our Sites. The information we automatically collect may include IP address, device identifier, web browser, and browsing information collected through cookies, web beacons, pixels, clear gifs, and other similar technologies (collectively Cookies and Other Tracking Technologies) on our Sites. We may also automatically collect information about how you use the Sites such as what you have searched for and viewed on the Sites. The information automatically collected will be associated with any personal data you have provided.'),
	(8,'A Child Education Planning Calculator is a sophisticated yet user-friendly online tool that helps you estimate and plan for your children\'s future education expenses. Designed by financial experts and based on current market analysis, this calculator takes the guesswork out of education financial planning on your behalf.'),
