INSERT INTO `components_corp_dynamic_c69s` (`id`, `description`)
VALUES
	(1,'Contained headline inflation and slower growth is positive for fixed income market. It will not only help RBI to infuse necessary durable system liquidity but also opens up the possibility of further rate cuts. Global growth inflation dynamics also prompted other key central banks to maintain their growth supportive stance. All these factors are favourable for the domestic fixed income market. Hence, in the near term interest rate movement is likely to be range bound with softer bias. However, over the medium term, Governments commitment towards fiscal deficit target, crude price movement, progress of monsoon and FII flows are likely to impact the market sentiment.'),
	(3,'Contained headline inflation and slower growth is positive for fixed income market. It will not only help RBI to infuse necessary durable system liquidity but also opens up the possibility of further rate cuts. Global growth inflation dynamics also prompted other key central banks to maintain their growth supportive stance. All these factors are favourable for the domestic fixed income market. Hence, in the near term interest rate movement is likely to be range bound with softer bias. However, over the medium term, Governments commitment towards fiscal deficit target, crude price movement, progress of monsoon and FII flows are likely to impact the market sentiment.');
