	(16,'Water Infrastructure for Agriculture','Water Recharge Pit (Jalkund): This initiative involves the reaction of water recharge pits, known as Jalkunds, to capture and store rainwater, replenishing the ground water table. Experience from benefits from Jalkund (water recharge pit) further motivated farmers from the adopted villages to scale up construction of Jalkunds in their villages. Our CSR has created social infrastructure through active community participation and sense of ownership and accountability. In this instance, community members, local government, Gram Panchayat are engaged in the CSR activities.',NULL),
	(17,'Improve Infrastructure of Government Schools','Project Jeevandhara is driving significant advancements in educational outcomes and fostering a bigger future for the next generation through creating a conducive learning environment for rural school children. The primary focus lies on transforming government school into model institutions equipped with comprehensive amenities and facilitating IT based education for under privileged students. This initiative aims to improve literacy rates in villages, increase students attendance and ensure minimum primary education for all.',NULL),
	(18,'Nalla and Pond Desilting','Water Recharge Pit (Jalkund): This initiative involves the reaction of water recharge pits, known as Jalkunds, to capture and store rainwater, replenishing the ground water table. Experience from benefits from Jalkund (water recharge pit) further motivated farmers from the adopted villages to scale up construction of Jalkunds in their villages. Our CSR has created social infrastructure through active community participation and sense of ownership and accountability. In this instance, community members, local government, Gram Panchayat are engaged in the CSR activities.',NULL),
	(19,'Farm Pond','Based on recommendations given by Senior Geologists and head of BhuJal Vidnyan Kendra, Dist. Jalna, Govt of Maharashtra, we have continued to undertake nalla deepening activities in view of percolation of maximum surface water that helps to increase the ground water level. These activities imrpove water retention and increase the ground water table, ensuring a steady supply of water for agriculture needs.',NULL),
	(20,'Drip Irrigation System','Water Recharge Pit (Jalkund): This initiative involves the reaction of water recharge pits, known as Jalkunds, to capture and store rainwater, replenishing the ground water table. Experience from benefits from Jalkund (water recharge pit) further motivated farmers from the adopted villages to scale up construction of Jalkunds in their villages. Our CSR has created social infrastructure through active community participation and sense of ownership and accountability. In this instance, community members, local government, Gram Panchayat are engaged in the CSR activities.',NULL),
	(21,'Training at KVK for Integrated Farming','Based on recommendations given by Senior Geologists and head of BhuJal Vidnyan Kendra, Dist. Jalna, Govt of Maharashtra, we have continued to undertake nalla deepening activities in view of percolation of maximum surface water that helps to increase the ground water level. These activities imrpove water retention and increase the ground water table, ensuring a steady supply of water for agriculture needs.',NULL),
	(28,'Enter Children Information','**Enter Children Information**\n- Number of Children: Select how many children you have below 18 years from the dropdown menu.\n- Current Savings: Enter the amount you\'ve already saved for your children\'s education in Rupees.\n- Monthly Savings: Input the amount you save each month for your children\'s education in Rupees.\n- Click the \"Next\" button to proceed to the next step.\n',NULL),
	(29,'Input Child-Specific Details','**Input Child-Specific Details**\n- Child\'s Date of Birth: Click on the calendar icon to select your child\'s birth date.\n- Monthly Savings: From the dropdown, select the amount you save each month specifically for this child\'s education.\n- Study Abroad Plans: Indicate whether you wish to send your child abroad for studies by selecting \"Yes\" or \"No\".\n- Click \"Next\" to view your results.',NULL),
