	(37,'Enter Your Basic Information','- Date of Birth: Click on the calendar icon to select your birth date.<br>\n- Desired Retirement Age: Enter the age at which you plan to retire.<br>\n- Living Expenses (Other than Rent): Input your monthly expenses, excluding rent.<br>\n- Monthly House Rent / Maintenance Bill: Enter your monthly rent or home maintenance costs.<br>\n- Expected Inflation Rate: Input the inflation rate you expect (as a percentage).<br>\nAfter filling in these details, click \'Next\' to proceed to the second step.\n',NULL),
	(38,'Provide Your Savings Information','- My Total Retirement Savings till now: Enter the total amount you\'ve saved for retirement so far.<br>\n- Monthly PF contribution: Input your monthly Provident Fund contribution.<br>\n- Monthly Savings for Retirement apart from PF: Enter any additional monthly savings you make towards retirement.<br>\n- Annual Interest Rate on Monthly Savings: Input the interest rate you expect to earn on your savings.<br>\nAfter filling in these details, click \'Next\' to proceed to the second step.<br>',NULL),
	(67,'Water Infrastructure for Agriculture','Water Recharge Pit (Jalkund): This initiative involves the reaction of water recharge pits, known as Jalkunds, to capture and store rainwater, replenishing the ground water table. Experience from benefits from Jalkund (water recharge pit) further motivated farmers from the adopted villages to scale up construction of Jalkunds in their villages. Our CSR has created social infrastructure through active community participation and sense of ownership and accountability. In this instance, community members, local government, Gram Panchayat are engaged in the CSR activities.',NULL),
	(68,'Improve Infrastructure of Government Schools','Project Jeevandhara is driving significant advancements in educational outcomes and fostering a bigger future for the next generation through creating a conducive learning environment for rural school children. The primary focus lies on transforming government school into model institutions equipped with comprehensive amenities and facilitating IT based education for under privileged students. This initiative aims to improve literacy rates in villages, increase students attendance and ensure minimum primary education for all.',NULL),
	(69,'Nalla and Pond Desilting','Water Recharge Pit (Jalkund): This initiative involves the reaction of water recharge pits, known as Jalkunds, to capture and store rainwater, replenishing the ground water table. Experience from benefits from Jalkund (water recharge pit) further motivated farmers from the adopted villages to scale up construction of Jalkunds in their villages. Our CSR has created social infrastructure through active community participation and sense of ownership and accountability. In this instance, community members, local government, Gram Panchayat are engaged in the CSR activities.',NULL),
	(70,'Farm Pond','Based on recommendations given by Senior Geologists and head of BhuJal Vidnyan Kendra, Dist. Jalna, Govt of Maharashtra, we have continued to undertake nalla deepening activities in view of percolation of maximum surface water that helps to increase the ground water level. These activities imrpove water retention and increase the ground water table, ensuring a steady supply of water for agriculture needs.',NULL),
	(71,'Drip Irrigation System','Water Recharge Pit (Jalkund): This initiative involves the reaction of water recharge pits, known as Jalkunds, to capture and store rainwater, replenishing the ground water table. Experience from benefits from Jalkund (water recharge pit) further motivated farmers from the adopted villages to scale up construction of Jalkunds in their villages. Our CSR has created social infrastructure through active community participation and sense of ownership and accountability. In this instance, community members, local government, Gram Panchayat are engaged in the CSR activities.',NULL),
	(72,'Training at KVK for Integrated Farming','Based on recommendations given by Senior Geologists and head of BhuJal Vidnyan Kendra, Dist. Jalna, Govt of Maharashtra, we have continued to undertake nalla deepening activities in view of percolation of maximum surface water that helps to increase the ground water level. These activities imrpove water retention and increase the ground water table, ensuring a steady supply of water for agriculture needs.',NULL),
