INSERT INTO `components_corp_subcomponent_c25_l1_cards` (`id`, `title`, `description`)
VALUES
	(1,'Listening skills','To apply for a life insurance plan is an emotional decision for an individual. To help your customers take the right decision, you need to know and understand their needs and backgrounds. Listen carefully to what they have to say and you will be on your way to a trustful and truthful customer relationship.'),
	(2,'Organizing skills','As an advisor who has to play multiple roles, getting organised is the primary trait you should possess. Make a summary of your plans and draw up a systematic plan to meet all your goals.'),
	(3,'Disciplined & work ethic','Being a boss of your own is not easy, it take a lot of self drive and discipline to achieve set goals. Though there is immense flexibility of working hours etc, it may work adversely for those who lack a disciplined approach and a casual work ethic.'),
	(4,'Team player','Learn to think as a group and not just as an individual. Take the team along with you in your thought process and work in co-operation with each other.'),
	(5,'Capability to build & drive relationships','If you cant invoke a feeling of trust in your customers, you can\'t think of a lasting relationship with them. Sensitivity to needs and trust are the corner stone of a successful insurance advisor. Direct your efforts towards it and things will fall in place.'),
