	(5,'Our Insurance Expertise','Established in 1902, Dai-ichi Life is the second largest life insurance company of Japan and is one of the top ten life insurers globally, renowned for sound product knowledge, superior asset management skills, and strong operational capabilities to manage life insurance businesses.'),
