	(22,'Project Dharti','Project Dharti','Our CSR initiatives are aimed at enhancing community well-being and driving sustainable development. With meaningful interventions, we strive to empower people and create a better and healthier society. Our CSR activities are categorized into two parts i.e. Aatmanirbhar Project and Other Initiatives. The Aatmanirbhar project is the foundation of our CSR agenda for villages. Focussing on self-sufficiency and holistic growth, this initiative aims to transform communities and enhance their standard of living. By promoting socio-economic empowerment, education, healthcare, and social well-being, the Aatmanirbhar project aims to build stronger and resilient villages.',NULL),
	(23,'Project Jeevandhara ','Project Jeevandhara ','Missing content',NULL),
	(24,'Project Sanjeevani','Project Sanjeevani (Health)','Access to primary healthcare is key to improving rural health care services. Around 80% of healthcare conditions can be addressed at the Primary Health Centre. By entering the primary health care services, this intervention helps to decrease the load on secondary and tertiary health care facilities. Project Sanjeevani is committed to fostering healthier rural communities and ensuring essential healthcare services are within reach for all. This initiative aims to provide timely medical assistance to villagers, enhancing accessibility to neo-natal care for newborns and pregnant women.\nIMPACTS\n1.Five villages (Raona, Nipani Pimplegaon, Dargha, Mangu-Jalgaon and Parada) have benefited from improved access to health care services.\n2.The PHC Sub-centre records a daily foot fall of around 30-40 patients\n3.Children are regularly vaccinated at this PHC Sub-centre.\n4.Pre-natal and ant-natal cares services are provided by PHC Sub-centre staff.\n5.Maternity services are available to women during emergency. Currently, medical services are available during the daytime. Plans are underway to provide 24x7 medical services.',NULL),
	(25,'Project Shakti','Project Shakti (Women Empowerment)','Project Shakti is committed to empowering women through skill development programmes focussing on health and hygiene and other initiatives aimed at enhancing their roles in village development. In order to make women financially independent, this project helps them to provide required support and foster their active participation. SHG Women have been trained through the vocational courses and encouraged to prepare the business plan for income generation.',NULL),
	(26,'Project Harit','Project Harit (ESG Initiative)','Project Harit focusses on large-scale tree plantation in government land of villages. This initiative is implemented in collaboration with local government with extended support of villagers and civil society organizations. The initiative benefits the environment by enhancing green cover and provides an additional source of income for intervening villages. Through these efforts Project Harit Promotes environmental sustainability and economic development in rural areas.',NULL),
	(27,'Project Swachchta','Project Swachchta','This initiative is a community-based initiative that aims to improve the cleanliness and health of village people. We conduct village cleanliness drives regular basis. We also provide required infrastructures to facilitate sustainable cleanliness. These drives have helped in adopting healthy practices at the household and community level. This initiative led to various changes such as increased an environmental awareness among the village people, helped to strengthen of SHGs groups and School children, its development of community institutions and local administration. Some of our intervening villages have participated in a \"Swachh Gaon\" competition conducted by State Government.',NULL),
	(34,'Women','Women','SUD Life presents the whole new world of opportunity to all women folk who have the time to become successful advisors . Becoming an advisor with SUD Life will open new doors for financial independence, reward and recognition, huge amount of learning and above all the satisfaction of achieving by being a team player. As an advisor you will touch upon the lives of your friends, family and associates and provide them with much needed financial planning\nadvice and security for their loved ones.',NULL),
	(35,'Financial Services Professionals','Financial Services Professionals','Financial Services Professions, who are already, engaged in the distribution of financial products and services, viz, general insurance agents, post office agents, mutual fund distributors, fixed deposit and income scheme brokers,\nretail loan distributors have a natural opportunity to progress in the distribution of life insurance products. Financial Planning of an individual is incomplete without adequacy of life insurance.',NULL),
	(36,'Young Graduates','Young Graduates','Teachers have several qualities which are common and conducive to being a successful advisor. Communication and presentation skills, humane qualities, patience, perseverance, emotional connect, discipline, good listening skills,\nmaking complicated concepts be explained in simple terms, organising skills, team player, meticulous, attention to detail, developing relationships to name a few. Becoming an insurance advisor comes naturally to Young Graduates\ndue to the inherent qualities in them which are the mantra for success for an advisor.\n',NULL),
	(37,'Independent Business Owner','Independent Business Owner','Self-employed independent business owners who wish to enhance their existing business incomes can make the most of this business opportunity by becoming an advisor with SUD Life.\n',NULL),
	(38,'Retired Professional','Retired Professional','You have seen the world and have toiled all your life. In the process you have enriched yourself with experience. This experience is your asset which you can make productive use of in your available spare time today to build your\nnew business as an advisor with SUD Life. The relationships which you have nurtured all your working span will stand to be benefited by your role as an insurance advisor post extensive training and development in the field\nof life insurance which you will receive post selection as an advisor.',NULL),
