	(85,'Project Dharti','Project Dharti','Our CSR initiatives are aimed at enhancing community well-being and driving sustainable development. With meaningful interventions, we strive to empower people and create a better and healthier society. Our CSR activities are categorized into two parts i.e. Aatmanirbhar Project and Other Initiatives. The Aatmanirbhar project is the foundation of our CSR agenda for villages. Focussing on self-sufficiency and holistic growth, this initiative aims to transform communities and enhance their standard of living. By promoting socio-economic empowerment, education, healthcare, and social well-being, the Aatmanirbhar project aims to build stronger and resilient villages.',NULL),
	(86,'Project Jeevandhara ','Project Jeevandhara ','Missing content',NULL),
	(87,'Project Sanjeevani','Project Sanjeevani (Health)','Access to primary healthcare is key to improving rural health care services. Around 80% of healthcare conditions can be addressed at the Primary Health Centre. By entering the primary health care services, this intervention helps to decrease the load on secondary and tertiary health care facilities. Project Sanjeevani is committed to fostering healthier rural communities and ensuring essential healthcare services are within reach for all. This initiative aims to provide timely medical assistance to villagers, enhancing accessibility to neo-natal care for newborns and pregnant women.\nIMPACTS\n1.Five villages (Raona, Nipani Pimplegaon, Dargha, Mangu-Jalgaon and Parada) have benefited from improved access to health care services.\n2.The PHC Sub-centre records a daily foot fall of around 30-40 patients\n3.Children are regularly vaccinated at this PHC Sub-centre.\n4.Pre-natal and ant-natal cares services are provided by PHC Sub-centre staff.\n5.Maternity services are available to women during emergency. Currently, medical services are available during the daytime. Plans are underway to provide 24x7 medical services.',NULL),
	(88,'Project Shakti','Project Shakti (Women Empowerment)','Project Shakti is committed to empowering women through skill development programmes focussing on health and hygiene and other initiatives aimed at enhancing their roles in village development. In order to make women financially independent, this project helps them to provide required support and foster their active participation. SHG Women have been trained through the vocational courses and encouraged to prepare the business plan for income generation.',NULL),
	(89,'Project Harit','Project Harit (ESG Initiative)','Project Harit focusses on large-scale tree plantation in government land of villages. This initiative is implemented in collaboration with local government with extended support of villagers and civil society organizations. The initiative benefits the environment by enhancing green cover and provides an additional source of income for intervening villages. Through these efforts Project Harit Promotes environmental sustainability and economic development in rural areas.',NULL),
	(90,'Project Swachchta','Project Swachchta','This initiative is a community-based initiative that aims to improve the cleanliness and health of village people. We conduct village cleanliness drives regular basis. We also provide required infrastructures to facilitate sustainable cleanliness. These drives have helped in adopting healthy practices at the household and community level. This initiative led to various changes such as increased an environmental awareness among the village people, helped to strengthen of SHGs groups and School children, its development of community institutions and local administration. Some of our intervening villages have participated in a \"Swachh Gaon\" competition conducted by State Government.',NULL),
