	(121,'Women','Women','SUD Life presents the whole new world of opportunity to all women folk who have the time to become successful advisors . Becoming an advisor with SUD Life will open new doors for financial independence, reward and recognition, huge amount of learning and above all the satisfaction of achieving by being a team player. As an advisor you will touch upon the lives of your friends, family and associates and provide them with much needed financial planning\nadvice and security for their loved ones.',NULL),
	(122,'Financial Services Professionals','Financial Services Professionals','Financial Services Professions, who are already, engaged in the distribution of financial products and services, viz, general insurance agents, post office agents, mutual fund distributors, fixed deposit and income scheme brokers,\nretail loan distributors have a natural opportunity to progress in the distribution of life insurance products. Financial Planning of an individual is incomplete without adequacy of life insurance.',NULL),
	(123,'Young Graduates','Young Graduates','Teachers have several qualities which are common and conducive to being a successful advisor. Communication and presentation skills, humane qualities, patience, perseverance, emotional connect, discipline, good listening skills,\nmaking complicated concepts be explained in simple terms, organising skills, team player, meticulous, attention to detail, developing relationships to name a few. Becoming an insurance advisor comes naturally to Young Graduates\ndue to the inherent qualities in them which are the mantra for success for an advisor.\n',NULL),
	(124,'Independent Business Owner','Independent Business Owner','Self-employed independent business owners who wish to enhance their existing business incomes can make the most of this business opportunity by becoming an advisor with SUD Life.\n',NULL),
	(125,'Retired Professional','Retired Professional','You have seen the world and have toiled all your life. In the process you have enriched yourself with experience. This experience is your asset which you can make productive use of in your available spare time today to build your\nnew business as an advisor with SUD Life. The relationships which you have nurtured all your working span will stand to be benefited by your role as an insurance advisor post extensive training and development in the field\nof life insurance which you will receive post selection as an advisor.',NULL);
