INSERT INTO `components_corp_subcomponent_c47_descriptions` (`id`, `description`)
VALUES
	(1,'The SUD Life E-Wealth Royale plan is designed to give the dual benefits of insurance protection and wealth creation. It helps you invest in the market and earn attractive returns to build a corpus for your financial goals. At the same time, life insurance coverage provides financial security to your family in your absence. There are two plan options, and the second option can serve as a tool for securing your childs financial future in your absence.  \n\nBesides earning market-linked returns, you also get to earn loyalty additions and wealth boosters that add to your fund value. The plan does not have any premium allocation charge and the other charges are also refunded on maturity, which reduces the overall costs and enhances returns.  \n\nSo, if you want a cost-effective way to create a corpus with the added benefit of insurance protection, SUD Life e-Wealth Royale can be a suitable choice. '),
	(6,'The POS  SUD Life Sanchay Plan is a smart insurance plan designed for those who want more than just life coverage. If youre looking for an effortless way to protect your loved ones while building a second income stream, this plan is for you. It guarantees a steady payout for ten years, providing financial security and peace of mind. \n\nAs the saying goes, Never depend on a single income, and this plan ensures youre taking a step towards creating a reliable backup for you and your family. \n \nYou can also save taxes under the Income Tax Act of 1961 for the premium payment. With life coverage and savings in one, SUD Life Sanchay offers a safety net for your familys future, helping you secure financial independence with guaranteed payoutseven after you\'re gone.'),
