	(59,'The SUD Life E-Wealth Royale plan is designed to give the dual benefits of insurance protection and wealth creation. It helps you invest in the market and earn attractive returns to build a corpus for your financial goals. At the same time, life insurance coverage provides financial security to your family in your absence. There are two plan options, and the second option can serve as a tool for securing your childs financial future in your absence.  \n\nBesides earning market-linked returns, you also get to earn loyalty additions and wealth boosters that add to your fund value. The plan does not have any premium allocation charge and the other charges are also refunded on maturity, which reduces the overall costs and enhances returns.  \n\nSo, if you want a cost-effective way to create a corpus with the added benefit of insurance protection, SUD Life e-Wealth Royale can be a suitable choice. '),
	(65,'The Human Life Value (HLV) is the translated average of your love, care, and support put into financial terms. Imagine all the times you\'ve helped with homework, cooked family dinners, or stayed up late worrying about bills. HLV tries to capture the economic aspect of these countless contributions.\n\nWhen we talk about Human Life Value (HLV), we\'re not just crunching numbers  we\'re trying to understand the financial impact you have on your family\'s life. It\'s about translating your love, care, and support into financial terms. Say all the times you\'ve helped with homework, cooked family dinners, or stayed up late worrying about bills? Yes, the Human Life Value Calculator tries to capture the economic aspect of your countless contributions.'),
	(68,'A retirement calculator is a powerful financial planning tool designed to help individuals estimate how much money they\'ll need to save for a comfortable retirement. It\'s like a financial crystal ball, giving you a glimpse into your future financial needs based on your current situation and future expectations.\nThe primary purpose of a retirement calculator is to answer a crucial question: \"Will I have enough money to maintain my desired lifestyle after I stop working?\" To achieve this, the calculator takes into account various factors:\n\n\n\n\n\n\n\n\n'),
	(69,'By processing these inputs, a retirement calculator provides estimates of:\n'),
	(70,'A term insurance plan is a protection-oriented plan which provides financial protection to the family in the breadwinners absence. SUD Protect Shield Plus does the same. It is also a term plan which offers optimal coverage at affordable premiums. It gives you the flexibility to choose the coverage level, the policy term and the premium payment term so that you can tailor the plan to your needs. \n\nSUD Life Protect Shield Plus pays a death benefit if the life insured dies during the policy term. This death benefit can give your family much-needed financial assistance when you are not around. They can use the funds to meet their lifestyle needs, to pay off existing loans, and even to fulfil the financial goals that they left unfulfilled.  So, with the SUD Life Protect Shield Plus, you can get financial protection at an affordable cost and give security to your family. Plus, the long-term coverage provides optimal protection. The icing on the cake is tax saving. You can save taxes under the Income Tax Act of 1961 for premium payments, and the death benefit is also tax-free income. '),
	(74,'A term insurance plan is a protection-oriented plan which provides financial protection to the family in the breadwinners absence. SUD Protect Shield Plus does the same. It is also a term plan which offers optimal coverage at affordable premiums. It gives you the flexibility to choose the coverage level, the policy term and the premium payment term so that you can tailor the plan to your needs. \n\nSUD Life Protect Shield Plus pays a death benefit if the life insured dies during the policy term. This death benefit can give your family much-needed financial assistance when you are not around. They can use the funds to meet their lifestyle needs, to pay off existing loans, and even to fulfil the financial goals that they left unfulfilled.  So, with the SUD Life Protect Shield Plus, you can get financial protection at an affordable cost and give security to your family. Plus, the long-term coverage provides optimal protection. The icing on the cake is tax saving. You can save taxes under the Income Tax Act of 1961 for premium payments, and the death benefit is also tax-free income. '),
	(75,'The SUD Life Century Royale plan is designed to give you peace of mind and financial security. Its a savings plan that offers long-term life coverage while providing guaranteed income, too. An assured income starts accruing from the 10th or 15th year of the policy, depending on the premium payment term that you choose. This income is payable till the end of the policy period. Essentially, you pay premiums for a limited period, but the benefits keep flowing throughout the policy. \n\nThis means youll have life protection in place, ensuring your loved ones are taken care of while also receiving a steady income for a set period. At the end of the policy term, youre rewarded with a guaranteed maturity benefit. \n\nYou can also avail yourself of a loan from SUD Life during the policy term, using the policy as collateral once it has acquired a surrender value. In addition to these benefits, the plan also allows you to enjoy tax advantages under the prevailing tax laws, making it a smart choice for those looking to maximise their savings while securing their future. Whether you\'re planning for your familys future or seeking a stable financial option for yourself, SUD Life Century Royale gives you the security and reliability you need. '),
	(82,'The SUD Life Century Royale plan is designed to give you peace of mind and financial security. Its a savings plan that offers long-term life coverage while providing guaranteed income, too. An assured income starts accruing from the 10th or 15th year of the policy, depending on the premium payment term that you choose. This income is payable till the end of the policy period. Essentially, you pay premiums for a limited period, but the benefits keep flowing throughout the policy. \n\nThis means youll have life protection in place, ensuring your loved ones are taken care of while also receiving a steady income for a set period. At the end of the policy term, youre rewarded with a guaranteed maturity benefit. \n\nYou can also avail yourself of a loan from SUD Life during the policy term, using the policy as collateral once it has acquired a surrender value. In addition to these benefits, the plan also allows you to enjoy tax advantages under the prevailing tax laws, making it a smart choice for those looking to maximise their savings while securing their future. Whether you\'re planning for your familys future or seeking a stable financial option for yourself, SUD Life Century Royale gives you the security and reliability you need. '),
	(83,'Think of the SUD e-Lifeline Term Insurance Plan as your family\'s safety net. It works like an umbrella under which your family is protected from the unexpected turn of events in life. For example, if you are the main breadwinner and something unfortunate happens to you. In due course, without your income, they could suffer serious financial distress-suffers trouble in paying for day-to-day expenses, paying off loans, or children\'s education. \n\nThis life insurance product works like a godfather who takes care of their expenses and helps them to maintain their earlier life even in your biological absence to provide for them.  So, with the SUD e-Lifeline Term Insurance Plan, you get complete financial protection. It covers the risk of premature demise and pays a lump sum death benefit to your family. Thus, you can get affordable, long-term coverage, which also helps you to save taxes under the Income Tax Act of 1961 for the premium payment. Thats a complete win-win situation, right? '),
	(87,'Think of the SUD e-Lifeline Term Insurance Plan as your family\'s safety net. It works like an umbrella under which your family is protected from the unexpected turn of events in life. For example, if you are the main breadwinner and something unfortunate happens to you. In due course, without your income, they could suffer serious financial distress-suffers trouble in paying for day-to-day expenses, paying off loans, or children\'s education. \n\nThis life insurance product works like a godfather who takes care of their expenses and helps them to maintain their earlier life even in your biological absence to provide for them.  So, with the SUD e-Lifeline Term Insurance Plan, you get complete financial protection. It covers the risk of premature demise and pays a lump sum death benefit to your family. Thus, you can get affordable, long-term coverage, which also helps you to save taxes under the Income Tax Act of 1961 for the premium payment. Thats a complete win-win situation, right? ');
