INSERT INTO `components_corp_subcomponent_c55_l1_items` (`id`, `title`, `description`)
VALUES
	(105,NULL,'When you buy SUD Life e-Wealth Royale, you choose the following details\nPlan option \nPolicy term  \nPremium payment term  \nPremium amount \nPremium payment frequency '),
	(106,NULL,'The sum assured will be determined based on the premium payment term that you choose. For single pay plans, the sum assured will be 1.25 times the single premium paid. For limited and regular pay plans, it will be 10 times the annualised premium paid. '),
	(107,NULL,'You will, then, have to choose the investment strategy for investing your premium. There are two strategies to choose from  Self-Managed Investment Strategy and Age-Based Investment Strategy.'),
	(108,NULL,'Self-Managed Investment Strategy\nUnder this strategy, you get a choice of eight fund options. You can invest your premium in any of these funds based on your risk appetite and investment preference. You can also switch the fund choices at your discretion. '),
	(109,NULL,'Age-Based Investment Strategy\nUnder this strategy, you choose your risk preference, which is aggressive or conservative. Based on your chosen risk profile, your premium will be allocated to two funds  Blue Chip Equity Fund and Gilt Fund. The allocation will then move from Blue Chip Equity Fund to Gilt Fund as your age advances. This is done to minimise risk at higher ages and protect your returns from short-term volatility'),
	(110,NULL,'The premium, net of applicable charges, is invested in the chosen funds based on the investment strategy that you choose. You can make switches or withdraw funds partially during the policy tenure if needed'),
	(111,NULL,'If the life insured dies during the policy tenure, the death benefit is paid depending on the plan option selected. The nominee can choose to receive the death benefit in instalments through the Settlement Option feature.'),
	(112,NULL,'If the life insured survives till maturity, the available fund value is paid as the maturity benefit'),
	(113,NULL,'When you buy SUD Life e-Wealth Royale, you choose the following details\nPlan option \nPolicy term  \nPremium payment term  \nPremium amount \nPremium payment frequency '),
	(114,NULL,'The sum assured will be determined based on the premium payment term that you choose. For single pay plans, the sum assured will be 1.25 times the single premium paid. For limited and regular pay plans, it will be 10 times the annualised premium paid. '),
	(115,NULL,'You will, then, have to choose the investment strategy for investing your premium. There are two strategies to choose from  Self-Managed Investment Strategy and Age-Based Investment Strategy.'),
	(116,NULL,'Self-Managed Investment Strategy\nUnder this strategy, you get a choice of eight fund options. You can invest your premium in any of these funds based on your risk appetite and investment preference. You can also switch the fund choices at your discretion. '),
	(117,NULL,'Age-Based Investment Strategy\nUnder this strategy, you choose your risk preference, which is aggressive or conservative. Based on your chosen risk profile, your premium will be allocated to two funds  Blue Chip Equity Fund and Gilt Fund. The allocation will then move from Blue Chip Equity Fund to Gilt Fund as your age advances. This is done to minimise risk at higher ages and protect your returns from short-term volatility'),
	(118,NULL,'The premium, net of applicable charges, is invested in the chosen funds based on the investment strategy that you choose. You can make switches or withdraw funds partially during the policy tenure if needed'),
	(119,NULL,'If the life insured dies during the policy tenure, the death benefit is paid depending on the plan option selected. The nominee can choose to receive the death benefit in instalments through the Settlement Option feature.'),
	(120,NULL,'If the life insured survives till maturity, the available fund value is paid as the maturity benefit'),
	(121,NULL,'When you buy the SUD Protect Shield Plus plan, you choose your\nSum assured (coverage amount) \nPolicy term  \nPremium payment term'),
	(122,NULL,'The annual premium will be calculated based on your age, gender, risk factors, policy details selected, etc. You need to pay the premium over the chosen policy term and in the chosen premium payment frequency. Once the premium is paid and the policy is issued, your coverage begins.'),
	(123,NULL,'If the life insured happens to pass away during the chosen policy tenure, the death benefit is paid in a lump sum. This benefit will give your family financial assistance in your absence.'),
	(124,NULL,'However, if the life insured manages to survive the policy tenure and the plan matures, no maturity benefit will be paid since this is a pure-term plan or a protection-only plan! '),
	(137,NULL,'When you buy the SUD Protect Shield Plus plan, you choose your\nSum assured (coverage amount) \nPolicy term  \nPremium payment term'),
	(138,NULL,'The annual premium will be calculated based on your age, gender, risk factors, policy details selected, etc. You need to pay the premium over the chosen policy term and in the chosen premium payment frequency. Once the premium is paid and the policy is issued, your coverage begins.'),
	(139,NULL,'If the life insured happens to pass away during the chosen policy tenure, the death benefit is paid in a lump sum. This benefit will give your family financial assistance in your absence.'),
	(140,NULL,'However, if the life insured manages to survive the policy tenure and the plan matures, no maturity benefit will be paid since this is a pure-term plan or a protection-only plan! '),
	(141,'01','Buy the SUD Life Century Royale Insurance Plan and choose the\nPolicy term  \nPremium payment term  \nPremium amount \nPremium payment frequency '),
	(142,'02','The death benefit, guaranteed income, and maturity benefits would depend on the premium payment term and the premium amount that you have chosen.'),
	(143,'03','You start receiving Guaranteed Income (GI) based on your premium payment term and policy term. For a 7-year premium term, payments start after the 10th year, and for a 12-year term, they begin after the 15th year, provided the policy is active. '),
	(144,'04','If you survive until the end of the policy term and your policy remains active, you will receive a Guaranteed Maturity Benefit. The amount is based on your premium payment term and is defined as 8 times your annual premium for a 7-year term or 15 times your annual premium for a 12-year term. '),
	(145,'05','If you pass away during the policy term, the Sum Assured on Death will be paid in a lump sum to your nominee. Your policy will then end, and no further benefits will be provided. '),
	(176,'01','Buy the SUD Life Century Royale Insurance Plan and choose the\nPolicy term  \nPremium payment term  \nPremium amount \nPremium payment frequency '),
	(177,'02','The death benefit, guaranteed income, and maturity benefits would depend on the premium payment term and the premium amount that you have chosen.'),
	(178,'03','You start receiving Guaranteed Income (GI) based on your premium payment term and policy term. For a 7-year premium term, payments start after the 10th year, and for a 12-year term, they begin after the 15th year, provided the policy is active. '),
	(179,'04','If you survive until the end of the policy term and your policy remains active, you will receive a Guaranteed Maturity Benefit. The amount is based on your premium payment term and is defined as 8 times your annual premium for a 7-year term or 15 times your annual premium for a 12-year term. '),
	(180,'05','If you pass away during the policy term, the Sum Assured on Death will be paid in a lump sum to your nominee. Your policy will then end, and no further benefits will be provided. '),
	(181,NULL,'Buy the SUD e-Lifeline Term Insurance Plan and choose your\nSum assured (coverage amount) \nPolicy term  '),
	(182,NULL,'The annual premium will be calculated based on your age, gender, risk factors, policy details selected, etc. You need to pay the premium over the chosen policy term and enjoy the coverage.'),
	(183,NULL,'In the case of death during the policy tenure, the Sum Assured on Death will be paid in a lump sum. This benefit will give your family financial assistance in your absence. '),
	(184,NULL,'However, if you survive the policy tenure and the plan matures, no maturity benefit will be paid since this is a pure-term plan or a protection-only plan!'),
	(197,NULL,'Buy the SUD e-Lifeline Term Insurance Plan and choose your\nSum assured (coverage amount) \nPolicy term  '),
	(198,NULL,'The annual premium will be calculated based on your age, gender, risk factors, policy details selected, etc. You need to pay the premium over the chosen policy term and enjoy the coverage.'),
	(199,NULL,'In the case of death during the policy tenure, the Sum Assured on Death will be paid in a lump sum. This benefit will give your family financial assistance in your absence. '),
	(200,NULL,'However, if you survive the policy tenure and the plan matures, no maturity benefit will be paid since this is a pure-term plan or a protection-only plan!');
