INSERT INTO `components_corp_subcomponent_c70_l1_cards` (`id`, `title`, `description`)
VALUES
	(1,'Equity','There were no major surprises in Q1 FY25 corporate earnings released during the month. Going ahead, net flows might be the key driver for the markets. Currently the benchmark Nifty 50 index is trading at a PE of 22x of Jun25 earnings. However, we believe sectors aligned to rural and household demand revival could eventually outperform considering the low base effect, even better than normal monsoon remain supportive for these stocks and sectors'),
	(2,'Fixed Income','US bond yields fell significantly (50 bps over 2 weeks) as softer inflation data and subsequent comments from the Federal Reserve were interpreted to mean near-certain rate cuts in September. In July, the domestic bond market was driven by strong FPI flows (~Rs 22,000 Cr), helped by lower amount of net borrowings in FY24 vis--vis FY24. The shorter end of the IGB yield curve appears more attractive in the near term, given the global developments and expectations of rate cuts in early CY25.'),
	(5,'Equity','There were no major surprises in Q1 FY25 corporate earnings released during the month. Going ahead, net flows might be the key driver for the markets. Currently the benchmark Nifty 50 index is trading at a PE of 22x of Jun25 earnings. However, we believe sectors aligned to rural and household demand revival could eventually outperform considering the low base effect, even better than normal monsoon remain supportive for these stocks and sectors'),
	(6,'Fixed Income','US bond yields fell significantly (50 bps over 2 weeks) as softer inflation data and subsequent comments from the Federal Reserve were interpreted to mean near-certain rate cuts in September. In July, the domestic bond market was driven by strong FPI flows (~Rs 22,000 Cr), helped by lower amount of net borrowings in FY24 vis--vis FY24. The shorter end of the IGB yield curve appears more attractive in the near term, given the global developments and expectations of rate cuts in early CY25.');
INSERT INTO `components_corp_subcomponent_c70_l1_texts` (`id`, `title`, `description`)
VALUES
	(1,'Equity Markets Continue to Soar','The month of July saw the new government present the Union Budget for FY2024-25. It focused on addressing concerns around employment through measures to promote skill development, support employment generation and increased focus on social development. Capex outlay remained unchanged from interim budget (3.5% of GDP), while adhering to the fiscal consolidation roadmap while projecting a fiscal deficit of 4.9% of GDP for FY2024-25. Equity markets continued scaling new heights throughout the month. Domestically, despite hike in capital gains taxes in the Union budget, the benchmark Nifty continued its march upwards, closing the month just shy of 25,000 points (which it subsequently crossed on 1st August).'),
	(2,'Fixed-Income Markets Stabilize','In the fixed-income markets, the 10Y G-Sec softened to 6.92% on positive foreign flows and strong macroeconomic fundamentals. Rainfall volume and distribution have progressed with most regions now in surplus or marginally below their long-term monsoon averages. A strong monsoon is essential in driving a rural recovery and keeping food prices in check.'),
	(3,'Global Monetary Policy Shifts','Globally, the Bank of England followed the ECB with a 25 bps rate cut in its July meeting. While the US Federal Reserve did not cut rates, the latest inflation readings and the comments from the US Federal Reserve have laid the groundwork for a rate cut at its next meeting in September. From a sectoral point of view, IT (~12%), Pharma (~9%), FMCG (~9%) and Auto (~6%) and Energy (~5%) were the top gainers, while Metals (~2%) and Bank (~2%) were the top losers. During the period, FIIs bought equities to the tune of Rs 5,408 Cr and DIIs bought equities to the tune of Rs 23,486 Cr. FPIs were net buyers of Indian equities to the tune of Rs 32,365 Cr.'),
	(7,'Equity Markets Continue to Soar','The month of July saw the new government present the Union Budget for FY2024-25. It focused on addressing concerns around employment through measures to promote skill development, support employment generation and increased focus on social development. Capex outlay remained unchanged from interim budget (3.5% of GDP), while adhering to the fiscal consolidation roadmap while projecting a fiscal deficit of 4.9% of GDP for FY2024-25. Equity markets continued scaling new heights throughout the month. Domestically, despite hike in capital gains taxes in the Union budget, the benchmark Nifty continued its march upwards, closing the month just shy of 25,000 points (which it subsequently crossed on 1st August).'),
	(8,'Fixed-Income Markets Stabilize','In the fixed-income markets, the 10Y G-Sec softened to 6.92% on positive foreign flows and strong macroeconomic fundamentals. Rainfall volume and distribution have progressed with most regions now in surplus or marginally below their long-term monsoon averages. A strong monsoon is essential in driving a rural recovery and keeping food prices in check.'),
	(9,'Global Monetary Policy Shifts','Globally, the Bank of England followed the ECB with a 25 bps rate cut in its July meeting. While the US Federal Reserve did not cut rates, the latest inflation readings and the comments from the US Federal Reserve have laid the groundwork for a rate cut at its next meeting in September. From a sectoral point of view, IT (~12%), Pharma (~9%), FMCG (~9%) and Auto (~6%) and Energy (~5%) were the top gainers, while Metals (~2%) and Bank (~2%) were the top losers. During the period, FIIs bought equities to the tune of Rs 5,408 Cr and DIIs bought equities to the tune of Rs 23,486 Cr. FPIs were net buyers of Indian equities to the tune of Rs 32,365 Cr.');
