INSERT INTO `glossaries` (`id`, `document_id`, `keyword`, `description`, `created_at`, `updated_at`, `published_at`, `created_by_id`, `updated_by_id`, `locale`)
VALUES
	(1,'g9o7uq6je6wj9jek0dmpcluq','Health Finances','You\'re the backbone of your family, working hard to make sure everyone is comfortable and happy. Your salary pays for the flat EMI, your kids\' school fees, and those occasional family trips to your hometown. Life\'s good.\nBut here\'s a thought that might keep you up at night - what if, suddenly, you\'re not around anymore? It\'s not an easy thing to consider, but it\'s crucial to think about.\nIf something happens to you, they receive a lump sum if you get the right term insurance plan at the right time. This payout can help them keep up with the monthly expenses, from paying the electricity bills to buying groceries. It can ensure your kids continue their education without interruption, from primary school all the way to college.\n','2024-12-31 07:36:46.172000','2024-12-31 07:36:48.561000',NULL,3,3,NULL),
