INSERT INTO `peoples` (`id`, `document_id`, `name`, `description`, `role`, `linked_in`, `created_at`, `updated_at`, `published_at`, `created_by_id`, `updated_by_id`, `locale`)
VALUES
	(1,'m1jxiaw5qeg3eu00llnxdxuj','Mr. M. Karthikeyan','Shri M. Karthikeyan has been serving as a Non-executive Director of the Company since August 2, 2024. He is Executive Director of Bank of India. During the professional journey of over 32 years, he has extensive exposure of Corporate office and field level banking. He was Zonal Manager of Dharmapuri, Pune and Chennai, North Zone. He was Field General Manager, Delhi, Controlling 8 Zones. He has also headed Recovery, Legal Department and HRM at Head Office, Mumbai.\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 12:55:19.698000','2024-12-02 08:12:47.177000',NULL,2,2,NULL),
	(3,'svmutghyp2gdq62uzi00qvnp','Mr. Abhay Tewari','Shri. Abhay Tewari joined the company in the year 2014 as Appointed Actuary. Prior to his appointment as Managing Director & CEO of the company, he was promoted as Joint President  Corporate & Chief Actuary, overseeing Operations, Actuarial, Risk and Corporate Governance functions. Shri. Tewari has played a critical role in enabling the growth trajectory of the company. He has led the Actuarial function and played a pivotal role in aligning the organization in achieving the strategic objectives over the years. Shri Tewari has total experience of over 25 years, a Fellow Member of the Institute of Actuaries of India (Investment specialisation) & UK (Life specialisation).He is also a CFA Charter Holder from CFA Institute of USA and holds a PGDBA from ICFAI Business School of Kolkata.\n\n',X'5B226469726563746F7273222C226D616E6167656D656E74225D','www.google.com','2024-11-27 13:02:58.594000','2024-12-02 08:24:37.790000',NULL,2,2,NULL),
	(5,'bmafbuszgny3d7etoam8jde8','Mr. Nitesh Ranjan','Shri Nitesh Ranjan has been serving as a Non-Executive Director of the Company since July 28, 2021. He is the Executive Director of Union Bank of India since March 10, 2021. Shri Ranjan has been with the Bank since 2008. He was Chief General Manager, responsible for steering Banks vision and goals including strategic agenda of end-to-end digitisation.\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:05:16.536000','2024-12-02 08:15:03.394000',NULL,2,2,NULL),
	(7,'j2fuzrhj3eq9yp6n7ubzkxii','Mr. Manjari Singh','Smt. Manjari Singh has been serving as an Independent Director of the Company since May 30, 2023. She is a Professor of Human Resource Management and Data Analysis at IIM Ahmedabad since 2000. She has experience in Human Resource matters and Corporate Management. She is Fellow IIM Kolkata and B.E. from REC Bhopal.\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:06:34.279000','2024-12-02 08:35:05.643000',NULL,2,2,NULL),
	(9,'w2mzzz2xlpi63jktgiz3bdpb','Mr. Yuichiro Abe','Shri Yuichiro Abe has been serving as a Non-Executive Director of the Company since May 30, 2023. He is Director, Deputy Chief Executive Officer, Chief Operating Officer of DLI Asia Pacific Pte. Ltd. (Singapore). He is associated with the Dai-ichi Life Insurance Co. Ltd. since 1993. He has vast experience in Legal, Compliance & Corporate Planning, Profit Management, Investment Planning and Risk Management.\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:07:47.570000','2024-12-02 08:26:03.807000',NULL,2,2,NULL),
	(11,'ko6a1hxod3gre6entckny0yu','Mr. Ashok Narain','Shri Ashok Narain has been serving as an Independent Director of the Company since July 28, 2023. He is Retired Chief General Manager, Department of Supervision, Reserve Bank of India. He is M.S. in Business Administration (Finance) - University of Rochester, New York, MBA - IIM Kolkata, LLB, CAIIB. He has held several leadership positions during the last 33 years of his service, particularly in the areas of financial supervision, consumer protection and enterprise wide risk management (ERM).\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:08:58.415000','2024-12-02 08:26:51.206000',NULL,2,2,NULL),
	(13,'rrorlbouatgzllo4s2unxq3q','Mr. Sharda Bhushan Rai','Shri Sharda Bhushan Rai has been serving as a Non-Executive Director of the Company since July 28, 2023. He is Chief General Manager, Bank of India (Head Office) heading Resources, CEBB, Call Centre, Marketing, Govt. Business Department, Third Party Products, Publicity & PR at Head Office, Mumbai. He is associated with Bank of India since 1990 and has worked in administration of small, medium, large as well as Exceptionally Large branches (Rural, Urban and Metropolitan) of the bank.\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:10:13.586000','2024-12-02 08:34:03.467000',NULL,2,2,NULL),
	(15,'z5xbshdmw4qqryyphxdms238','Mr. Ashutosh Pednekar','Shri Ashutosh Pednekar has been serving as an Independent Director of the Company since February 6, 2024. He is a Fellow Member of Institute of Chartered Accountants of India. He is a partner of M. P. Chitale & Co. since 1992 and he was also member of various committees of IRDAI & RBI. He has garnered wide experience in Banking, Insurance, Financial Services and other sectors.\n',X'5B226469726563746F7273225D',NULL,'2024-11-27 13:11:21.320000','2024-12-02 08:28:13.146000',NULL,2,2,NULL),
	(17,'g3g4x8ya7vw4ccdxb25hkuwi','Mr. Junichi Yoshii','Shri Junichi Yoshii has been serving as a Non-executive Director of the Company since May 3, 2024. He joined the Dai-ichi Mutual Life Insurance Co. Ltd. from April 2000. He is Chief Financial Officer & Chief Risk Officer of DLI Asia Pacific PTE. LTD. He has vast experience of Risk, Finance, Investment and Corporate Planning Department.\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:12:25.879000','2024-12-02 08:36:18.089000',NULL,2,2,NULL),
	(19,'der5mnx5f221mz9sjbjv85gi','Mr. Rajiv Kumar Jha','Shri Rajiv Kumar Jha has been serving as a Non-executive Director of the Company since May 3, 2024. He is General Manager, Union Bank of India (Head Office) from Strategy Department. He has more than 2 decades of experience in BFSI sector including Core Banking, Strategy Formulation, Analytics, Finance & Accounts, Marketing and experience of working in different geographies of the Country.\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:13:38.533000','2024-12-02 08:38:30.631000',NULL,2,2,NULL),
	(21,'i0qga381vvtmjhoskg6u07ht','Mr. Brett Clark','Shri Brett Clark has been serving as a Non-executive Director of the Company since August 2, 2024. Since July 1, 2024, He is CEO & Managing Director of DLI Asia Pacific Pte. Ltd. Earlier, he was Group CEO & Managing Director of Tal Dai-ichi Life Australia Limited (Formally known as TAL). He has vast experience of more than 30 years in Actuarial, Diversity and Inclusion, Strategic Partnerships, Merger & Acquisitions and other market initiatives.\n\n',X'5B226469726563746F7273225D','www.linkedin.com','2024-11-27 13:14:42.264000','2024-12-02 08:35:42.365000',NULL,2,2,NULL),
